import React, { Component } from "react";
import PropTypes from "prop-types";

export class Navbar extends Component {
  static defaultProp = {
    title: "Github Finder",
    icon: "fab fa-github"
  };

  static render() {
    return (
      <nav className=" navbar bg-primary">
        <h1>
          <i class={this.props.icon} />
          {this.props.title}
        </h1>
      </nav>
    );
  }
}

export default Navbar;
